def generate_board(size):
    """ Generates a game board given an integer size where size = length = width of the board.
    Black stone is represented by 1 and white stone is represented by 2.
    Returns the generated board.
    """
    # Return empty board if invalid size
    if size <= 0:
        return []

    # Create the board
    board = []
    for i in range(size):
        row = []
        for j in range(size):
            if (i + j) % 2 == 0:
                row.append(1)  # Black stones start at (0, 0) alternating until end at (size - 1, size - 1)
            else:
                row.append(2)  # White stones start at (0, 1) alternating until end at (size - 1, size - 2)
        board.append(row)  # Add row to board
    return board


def generate_board_r(rows, cols):
    """ Generates a game board given number of rows and columns.
    Black stone is represented by 1 and white stone is represented by 2.
    Returns the generated board.
    """
    # Return empty board if invalid dimensions
    if rows <= 0 or cols <= 0:
        return []

    # Create the board
    board = []
    for i in range(rows):
        row = []
        for j in range(cols):
            if (i + j) % 2 == 0:
                row.append(1)  # Black stones start at (0, 0) alternating until end at (size - 1, size - 1)
            else:
                row.append(2)  # White stones start at (0, 1) alternating until end at (size - 1, size - 2)
        board.append(row)  # Add row to board
    return board


def copy_board(board):
    """ Returns a deep copy of the given board.
    """
    board_copy = []
    for row in board:
        board_copy.append(row[:])
    return board_copy


def get_board_as_string(board, move=None):
    """ Returns a string representation of the board.
    ○ = white, ● = black.
    If move is not None, the ending spot will be colored red and the starting spot marked with a red X.
    """
    # Column labels
    display = "   "  # Spacing
    for i in range(len(board[0])):
        display += str(i % 10) + " "
    display += "\n"
    frame = "  +" + "-+" * len(board[0])  # Create frame string to be added to display every row
    # For each row in the board
    for i in range(len(board)):
        display += frame + "\n"  # Add the frame
        display += str(i % 10) + " |"  # Add the row label on far left
        # For each column in the row
        for j in range(len(board[i])):
            if board[i][j] == 1:  # Black stone
                if move is not None and i == move[1][0] and j == move[1][1]:
                    display += "\033[91m●\033[0m|"  # Change stone's color to red if this is the ending spot
                else:
                    display += "●|"  # Add black stone
            elif board[i][j] == 2:  # White stone
                if move is not None and i == move[1][0] and j == move[1][1]:
                    display += "\033[91m○\033[0m|"  # Change stone's color to red if this is the ending spot
                else:
                    display += "○|"  # Add white stone
            else:  # Empty space
                if move is not None and i == move[0][0] and j == move[0][1]:
                    display += "\033[91mX\033[0m|"  # Change color to red and add X to represent starting spot
                else:
                    display += " |"  # Add empty cell
        display += "\n"
    display += frame  # Close out the end of the board with a frame
    return display


def prep_board_human(board):
    """ Prompt the user to enter two row and column locations and remove the stone at those two locations.
    The two locations must be of different colors, and if the same color is
    picked twice the user should be re-prompted.
    Additionally, both of the selected stones must not be on the board’s edge.
    Returns nothing but modifies the given board.
    """
    print(get_board_as_string(board))  # Print the board for the user to see
    first_stone = []
    second_stone = []
    while not first_stone or not second_stone:
        # Get user input to select row and col of the stone to remove
        row = int(input("Enter a row value: "))
        col = int(input("Enter a col value: "))

        # If the user entered an invalid row or col, prompt again
        if row <= 0 or row >= len(board)-1 or col <= 0 or col >= len(board)-1:
            print("Please choose a different stone")
            continue
        if not first_stone:  # If first_stone has not been selected, set the first_stone
            first_stone = [row, col]
        elif not second_stone:  # If second_stone has not been selected, set the second_stone
            # If the first_stone and second_stone are the same color, prompt again
            if board[first_stone[0]][first_stone[1]] == board[row][col]:
                print("Please choose a different stone")
            else:
                second_stone = [row, col]
    # Set both the first and second stones to 0 on the given board
    board[first_stone[0]][first_stone[1]] = board[second_stone[0]][second_stone[1]] = 0


def prep_board_auto(board):
    """ Picks two random stones to remove from the board.
    The two locations must be of different colors and not on the board's edge.
    Modifies the given board.
    """
    board_size = len(board)

    # Pick two random stones within valid range on the board
    first_stone = (random.randrange(1, board_size - 1), random.randrange(1, board_size - 1))
    second_stone = (random.randrange(1, board_size - 1), random.randrange(1, board_size - 1))

    # Brute force pick a random second stone until the two stones are not the same color
    while board[first_stone[0]][first_stone[1]] == board[second_stone[0]][second_stone[1]]:
        second_stone = [random.randrange(1, board_size - 1), random.randrange(1, board_size - 1)]

    # Set both the first and second stones to 0 on the given board
    board[first_stone[0]][first_stone[1]] = board[second_stone[0]][second_stone[1]] = 0


def is_valid_move(board, move):
    """ Returns True if the move is valid, False otherwise.
    A move is valid if: the start and end positions are on the board,
    the start and end positions are different,
    the start and end positions are the same color space,
    the move is a valid sequence of jumps,
    the move isn't diagonal,
    and there is an actual start stone and an empty end space.
    """
    start = move[0]
    end = move[1]

    # Quick checks
    if (start[0] < 0 or start[0] >= len(board) or start[1] < 0 or start[1] >= len(board[0]) or
            end[0] < 0 or end[0] >= len(board) or end[1] < 0 or end[1] >= len(board[0])):  # Out of bounds
        return False
    if board[start[0]][start[1]] == 0 or board[end[0]][end[1]] != 0:  # No stone at start or already a stone at end
        return False
    if start == end:  # Same position
        return False
    if start[0] != end[0] and start[1] != end[1]:  # Diagonal move
        return False
    if start[0] % 2 != end[0] % 2 or start[1] % 2 != end[1] % 2:  # Wrong colored space
        return False

    # Check if the move is a valid sequence of jumps
    consecutive_zeros = 0
    consecutive_stones = 0
    # If start and end are the same row/col, row/col step is 0 otherwise step is 1 or -1 depending on the direction
    row_step = (end[0] - start[0]) // max(1, abs(end[0] - start[0])) if start[0] != end[0] else 0
    col_step = (end[1] - start[1]) // max(1, abs(end[1] - start[1])) if start[1] != end[1] else 0

    row, col = start[0] + row_step, start[1] + col_step

    while (row, col) != (end[0] + row_step, end[1] + col_step):
        if board[row][col] == 0:
            consecutive_stones = 0
            consecutive_zeros += 1
        else:
            consecutive_zeros = 0
            consecutive_stones += 1
        if consecutive_stones > 1 or consecutive_zeros > 1:
            return False
        row += row_step
        col += col_step
    return True


def get_valid_moves_for_stone(board, stone):
    """ Returns a list of valid moves for the given stone position.
    Returns an empty list if there are no valid moves.
    """
    moves = []

    for r in range(len(board)):
        for c in range(len(board[0])):
            if is_valid_move(board, (stone, (r, c))):
                moves.append((stone, (r, c)))
    return moves


def get_valid_moves(board, player):
    """ Returns a list of valid moves for the given player (1=Black or 2=White).
    Returns an empty list if there are no valid moves.
    """
    moves = []

    for r in range(len(board)):
        for c in range(len(board[0])):
            if board[r][c] == player:
                moves.extend(get_valid_moves_for_stone(board, (r, c)))
    return moves


def human_player(board, player):
    """ Returns a valid move for the given player (1=Black or 2=White).
    Returns an empty tuple if there are no valid moves.
    Prompts the user to enter a valid move and returns the user’s valid move.
    """
    valid_moves = get_valid_moves(board, player)
    if not valid_moves:
        return ()

    print(get_board_as_string(board))

    if player == 1:
        print("Enter a valid move for ●:")
    elif player == 2:
        print("Enter a valid move for ○:")
    else:
        print("Invalid player.")
        return ()

    while True:
        user_move = ((int(input("Enter Starting row: ")), int(input("Enter Starting col: "))),
                     (int(input("Enter Ending row: ")), int(input("Enter Ending col: "))))
        if user_move in valid_moves:
            return user_move
        print(f"{user_move} is not a valid move. Try again.")


def random_player(board, player):
    """ Returns a random move for the given player (1=Black or 2=White).
    Returns an empty tuple if there are no valid moves.
    """
    valid_moves = get_valid_moves(board, player)
    if valid_moves:
        return random.choice(valid_moves)
    else:
        return ()


