def validate_ai(ai_black, ai_white, board, games=1, highlight=False):
    """ Plays games number of games of Konane between the two given AI agent functions (ai_black and ai_white)
    Default is just 1 game played.
    Given board is expected to be 10x10.
    Agents play on the given board where the first player to start for each game is chosen at random.
    If highlight is True, we will print the board and highlight the players' moves in red after each move.
    Returns the total amount of black wins and white wins.
    """
    print("Validating...")
    black_wins = 0
    white_wins = 0

    for i in range(games):  # Play each game
        board = generate_board(len(board))
        prep_board_auto(board)

        black_first = random.randint(0, 1) == 1  # Randomly choose who goes first
        game_over = False

        while not game_over:
            if black_first:
                black_move = ai_black(board, 1)
                if black_move == ():  # Black cant move and white wins
                    white_wins += 1
                    game_over = True
                    continue
                make_move(board, black_move, 1, highlight)

                white_move = ai_white(board, 2)
                if white_move == ():  # White cant move and black wins
                    black_wins += 1
                    game_over = True
                    continue
                make_move(board, white_move, 2, highlight)
            else:
                white_move = ai_white(board, 2)
                if white_move == ():  # White cant move and black wins
                    black_wins += 1
                    game_over = True
                    continue
                make_move(board, white_move, 2, highlight)

                black_move = ai_black(board, 1)
                if black_move == ():  # Black cant move and white wins
                    white_wins += 1
                    game_over = True
                    continue
                make_move(board, black_move, 1, highlight)
    return black_wins, white_wins


def play_game(ai_black, ai_white, board):
    """ Plays an entire game of Konane between the two given AI agent functions (ai_black and ai_white)
    Given board should be 10x10 and already prepped.
    Agents play on the given board where the first player to start is chosen at random.
    Returns 1 if Black wins and 2 if White wins.
    """
    black_first = random.randint(0, 1) == 1  # Randomly choose who goes first

    while True:  # Run 1 turn of the game each loop until someone wins
        if black_first:
            black_move = ai_black(board, 1)
            if black_move == ():  # Black cant move and white wins
                return 2
            make_move(board, black_move, 1)

            white_move = ai_white(board, 2)
            if white_move == ():  # White cant move and black wins
                return 1
            make_move(board, white_move, 2)
        else:
            white_move = ai_white(board, 2)
            if white_move == ():  # White cant move and black wins
                return 1
            make_move(board, white_move, 2)

            black_move = ai_black(board, 1)
            if black_move == ():  # Black cant move and white wins
                return 2
            make_move(board, black_move, 1)


def make_move(board, move, player, highlight=False):
    """ Updates the given board with the given move for the given player.
    Assumes the provided move is valid.
    If highlight is True, we print the board and highlight the move in red.
    Returns nothing but updates the board with the move.
    """
    start = move[0]
    end = move[1]
    # Move starting stone to the end position
    board[start[0]][start[1]] = 0
    board[end[0]][end[1]] = player

    # If start and end are the same row/col, row/col step is 0 otherwise step is 1 or -1 depending on the direction
    row_step = (end[0] - start[0]) // max(1, abs(end[0] - start[0])) if start[0] != end[0] else 0
    col_step = (end[1] - start[1]) // max(1, abs(end[1] - start[1])) if start[1] != end[1] else 0

    # Remove stones in the jump
    row, col = start[0] + row_step, start[1] + col_step
    while (row, col) != end:  # While we have not reached the end
        if board[row][col] != player:  # If the current stone is an opponent stone remove it
            board[row][col] = 0
        row += row_step
        col += col_step
    if highlight:
        print(get_board_as_string(board, move))


class Neuron:
    def __init__(self, num_prev_neurons):
        """ Initializes a Neuron with random weights and a random bias if previous neurons is provided.
        """
        self.weights = []
        self.bias = 0.0
        # If this is the input layer (1st layer) we don't need weights or biases
        if num_prev_neurons is not None:
            # Need a weight for each connected neuron in the previous layer
            for i in range(num_prev_neurons):
                self.weights.append(random.uniform(-0.5, 0.5))
            self.bias = random.uniform(-0.5, 0.5)
        self.value = 0

    def copy(self):
        """ Returns a deep copy of this Neuron.
        """
        neuron_copy = Neuron(None)
        neuron_copy.weights = self.weights[:]
        neuron_copy.bias = self.bias
        neuron_copy.value = self.value
        return neuron_copy


class NeuralNetwork:
    def __init__(self, layers):
        """ Initializes network with given layers of neurons.
        Ex: layers of [4, 8, 3] means 4 input nodes, 8 hidden neurons, 3 output nodes
        """
        self.id = -1
        self.layers = layers
        self.neurons = []
        self.fitness = 0
        for i in range(len(layers)):
            self.neurons.append([])
            for j in range(layers[i]):
                if i == 0:  # Input layer
                    self.neurons[i].append(Neuron(None))
                else:  # Hidden or output layer
                    self.neurons[i].append(Neuron(layers[i-1]))

    def feed_forward(self, inputs):
        """ Returns the output of the neural network for the given inputs.
        """
        for i in range(len(inputs)):
            self.neurons[0][i].value = inputs[i]  # Set input nodes

        for i in range(1, len(self.layers)):
            for j in range(len(self.neurons[i])):
                value = 0
                for k in range(len(self.neurons[i][j].weights)):
                    # Sum prev neuron values * it's weight
                    value += self.neurons[i-1][k].value * self.neurons[i][j].weights[k]
                self.neurons[i][j].value = self.activate(value + self.neurons[i][j].bias)  # Activate sum + bias
        return self.neurons[-1]  # Return output layer

    def mutate(self, rate, strength):
        """ Mutates the network with the given rate and strength.
        """
        for i in range(1, len(self.layers)):
            for j in range(self.layers[i]):
                if random.random() < rate:
                    self.neurons[i][j].bias += random.uniform(-strength, strength)
                for k in range(len(self.neurons[i][j].weights)):
                    if random.random() < rate:
                        self.neurons[i][j].weights[k] += random.uniform(-strength, strength)

    @staticmethod
    def activate(x):
        """ Activation function for the network.
        """
        return math.tanh(x)

    def copy(self):
        """ Returns a deep copy of this NeuralNetwork.
        """
        nn_copy = NeuralNetwork(self.layers)
        for i in range(len(self.layers)):
            for j in range(self.layers[i]):
                nn_copy.neurons[i][j] = self.neurons[i][j].copy()
        nn_copy.fitness = self.fitness
        return nn_copy

    def visualize(self):
        """ Prints a visualization of the neural network in the console with neurons on each layer listed vertically.
        Each neuron is printed with its index and bias.
        Don't know how to cleanly print and connect weights between all the neurons, so I've left them out.
        """
        # Printing horizontally has wraparound issues so we print vertically
        max_col = max([self.layers[i] for i in range(len(self.layers))])  # Find maximum column length
        max_spaces = 15  # Maximum number of spaces between each item printed

        # Print title labeling each layer
        title = "Inputs:" + " " * (max_spaces-7)
        for i in range(1, len(self.layers)-1):
            title += f"Hidden {i}:" + " " * (max_spaces-9-(i//10))
        title += "Outputs:"
        print(title)

        # Print neurons by column
        for c in range(max_col):
            for r in range(len(self.neurons)):
                if c < len(self.neurons[r]):  # If there is a neuron in this column in this row
                    neuron_visual = f"({c} {self.neurons[r][c].bias:.2f})"  # Neuron print is the column index and bias
                    spaces = max_spaces - len(neuron_visual)
                    print(neuron_visual, end=" " * spaces)
                else:  # If there is no neuron in this column in this row fill it with spaces
                    print(" " * max_spaces, end="")
            print()

    def print_weights_biases(self):
        """ Prints out weights and biases of this neural network in console.
        This function exists so I can copy/paste the weights and biases since cant import pickle.
        Copy/pasted biases and weights then used in ai_player function to initialize the best network.
        """
        # First layer is empty (input nodes)
        biases = "[[]"
        weights = "[[]"

        for i in range(1, len(self.layers)):
            # Start new list: Each layer has its own list of weights and biases
            biases += ",\n  ["
            weights += ",\n ["
            for j in range(self.layers[i]):
                if j == self.layers[i] - 1:
                    biases += f"{self.neurons[i][j].bias}]"  # Add bias with closing bracket
                else:
                    biases += f"{self.neurons[i][j].bias}, "  # Add bias with comma for next bias in list
                weights += "["  # Start new list: Each neuron has its own list of weights for previous neurons
                for k in range(len(self.neurons[i][j].weights)):  # Add each weight from this neuron
                    if k == len(self.neurons[i][j].weights) - 1:  # If this is the last weight in the neuron's weights
                        if j == self.layers[i] - 1:  # If this is the last neuron in the layer
                            # Add closing bracket no comma
                            weights += f"{self.neurons[i][j].weights[k]}]"
                        else:
                            # Add closing bracket with comma for next neuron's weights list
                            weights += f"{self.neurons[i][j].weights[k]}],\n    "
                    else:  # If this is not the last weight
                        weights += f"{self.neurons[i][j].weights[k]}, "  # Add the weight with comma for next weight
            weights += "]"  # Close out the weights list at the end of the layer
        biases += "]"  # Close out the biases
        weights += "]"  # Close out the weights
        print(biases)
        print()
        print(weights)


def ai_make_move(board, net, player):
    """ Makes a move on the board with the given network.
    Returns True if the net can move False if not.
    """
    inputs = NetworkTrainer.generate_inputs(board, player)  # Generate AI inputs from board
    outputs = net.feed_forward(inputs)  # Feed inputs into network and get outputs
    move = NetworkTrainer.parse_outputs(board, outputs, player)  # Get the best valid move from outputs
    if move == ():  # Net cant move and opponent wins
        return False
    make_move(board, move, player)  # Make the move
    return True


def evaluate(board, current_net, eval_nets):
    """ Runs current_net against eval_nets and sums the fitness from each game played.
    Returns evaluated fitness of current_net.
    """
    fitness = 0
    games_done = False

    # Initialize list of copied boards for each simulated game between current_net and the nets in eval_nets
    boards = []
    for i in range(len(eval_nets)):
        boards.append(copy_board(board))

    while not games_done:
        games_done = True
        for i in range(len(boards)):
            if boards[i]:  # If the game at index i is not over
                games_done = False
                # Run current_net in all possible orders (0: black 1st, 1: black 2nd, 2: white 1st, 3: white 2nd)
                match i % 4:
                    case 0:  # current_net is black and goes 1st
                        if not ai_make_move(boards[i], current_net, 1):  # Black cant move. current_net loses
                            boards[i] = None  # Mark this game as over
                            continue

                        if not ai_make_move(boards[i], eval_nets[i], 2):  # White cant move. current_net wins
                            fitness += 1
                            boards[i] = None  # Mark this game as over
                            continue
                    case 1:  # current_net is black and goes 2nd
                        if not ai_make_move(boards[i], eval_nets[i], 2):  # White cant move. current_net wins
                            fitness += 1
                            boards[i] = None  # Mark this game as over
                            continue

                        if not ai_make_move(boards[i], current_net, 1):  # Black cant move. current_net loses
                            boards[i] = None  # Mark this game as over
                            continue
                    case 2:  # current_net is white and goes 1st
                        if not ai_make_move(boards[i], current_net, 2):  # White cant move. current_net loses
                            boards[i] = None  # Mark this game as over
                            continue

                        if not ai_make_move(boards[i], eval_nets[i], 1):  # Black cant move. current_net wins
                            fitness += 1
                            boards[i] = None  # Mark this game as over
                            continue
                    case 3:  # current_net is white and goes 2nd
                        if not ai_make_move(boards[i], eval_nets[i], 1):  # Black cant move. current_net wins
                            fitness += 1
                            boards[i] = None  # Mark this game as over
                            continue

                        if not ai_make_move(boards[i], current_net, 2):  # White cant move. current_net loses
                            boards[i] = None  # Mark this game as over
                            continue
    return fitness


def find_position(row_size, col_size, index, player):
    """ Returns the board position of the given index of the player.
    For example, on a 3x3 board, if player is 1: i=0 is (0,0), i=1 is (0,2), i=2 is (1,1).
    """
    count = 0
    for r in range(row_size):
        if player == 1:
            start_col = 0 if r % 2 == 0 else 1  # For black: Start column is 0 if r is even, 1 if r is odd
        else:
            start_col = 1 if r % 2 == 0 else 0  # For white: Start column is 1 if r is even, 0 if r is odd
        for c in range(start_col, col_size, 2):  # Skip every other column starting from start_col
            if count == index:
                return r, c
            count += 1  # Increment count for each of this player's stones


class NetworkTrainer:
    def __init__(self, row_size, col_size, population_size, layers, mutate_rate, mutate_strength):
        """ Initializes the NetworkTrainer with given parameters.
        Generates a population of neural networks given the size.
        Initializes each neural network with given layers.
        Sets the mutate rate and strength for all networks.
        """
        if os.path.exists("saved_population.pkl"):  # If there is a saved population load it
            with open("saved_population.pkl", "rb") as file:
                self.nets = pickle.load(file)

                # Add new networks if loaded population is not big enough
                if len(self.nets) < population_size:
                    for i in range(population_size - len(self.nets)):
                        self.nets.append(NeuralNetwork(layers))
        else:
            # If there is no saved population (or when we cant import pickle) create new networks
            self.nets = []
            for i in range(population_size):
                self.nets.append(NeuralNetwork(layers))

        # Initialize old_nets to evaluate current nets against
        self.old_nets = []
        for i in range(population_size):
            self.old_nets.append(self.nets[i].copy())
            self.nets[i].id = i  # Set id for each network

        self.mutate_rate = mutate_rate  # Percent chance for each network parameter (weight/bias) to mutate
        self.mutate_strength = mutate_strength  # Range from -mutate_strength to +mutate_strength for each mutation
        self.population_size = population_size

        self.row_size = row_size
        self.col_size = col_size

    @staticmethod
    def generate_inputs(board, player):
        """ Returns a list of inputs for the given board to be fed into the AI player.
        Each input node represents each square on the board (1=network's stone, -1=opponent's stone, 0=empty)
        """
        inputs = []
        for row in board:
            for col in row:
                if col == player:
                    inputs.append(1)
                elif col == 0:
                    inputs.append(0)
                else:
                    inputs.append(-1)
        return inputs

    @staticmethod
    def parse_outputs(board, outputs, player):
        """ Returns the highest confidence and valid move from the given AI player.
        Returns empty tuple if no valid move is found.
        """
        # Split the outputs into two lists: One for starting stone and one for ending square
        split_outputs = {
            "from": outputs[:len(outputs) // 2],
            "to": outputs[len(outputs) // 2:]
        }

        # Save the position of each output value before sorting by value
        for i in range(len(split_outputs["from"])):
            split_outputs["from"][i] = (i, split_outputs["from"][i].value)
            split_outputs["to"][i] = (i, split_outputs["to"][i].value)

        # Sort both lists from largest to smallest confidence
        split_outputs["from"].sort(key=lambda x: x[1], reverse=True)
        split_outputs["to"].sort(key=lambda x: x[1], reverse=True)

        row_size = len(board)
        col_size = len(board[0])
        # Find the first highest confidence and valid output move for this player
        for from_output in split_outputs["from"]:
            start_pos = find_position(row_size, col_size, from_output[0], player)
            for to_output in split_outputs["to"]:
                end_pos = find_position(row_size, col_size, to_output[0], player)
                move = (start_pos, end_pos)
                if is_valid_move(board, move):
                    return move
        return ()

    def train(self, generations):
        """ Runs the loop that trains the AI for the given number of generations.
        Returns the best network at the end of the training.
        If generations < 0 the loop will run until the user presses Ctrl+C.
        """
        # Counter for generations
        generation = 1

        print("Starting training...")
        start_time = time.time()  # Start timer
        with mp.Pool(processes=8) as pool:
            while generation <= generations or generations < 0:
                results = []  # Multiprocessing results

                # Generate and prep a new template board every generation
                template_board = generate_board_r(self.row_size, self.col_size)
                prep_board_auto(template_board)
                for i in range(self.population_size):
                    # Running each evaluation in parallel
                    results.append(pool.apply_async(evaluate, (template_board, self.nets[i], self.old_nets)))

                # Wait for all processes to finish and save each network's fitness
                for i in range(len(results)):
                    result = results[i].get()
                    self.nets[i].fitness = result

                for i in range(len(self.nets)):
                    self.old_nets[i] = self.nets[i].copy()  # Prepare old_nets for next generation's evaluation

                # Sorting and mutation
                self.nets.sort(key=lambda x: x.fitness)  # Sort nets by fitness
                print(f"Generation {generation} finished in {time.time() - start_time:.2f} seconds.")
                print(f"Best network: ID{self.nets[-1].id} {self.nets[-1].fitness}/{len(self.nets)} "
                      f"{(self.nets[-1].fitness / (len(self.nets)))*100:.2f}%")
                print(f"Worst network: ID{self.nets[0].id} {self.nets[0].fitness}/{len(self.nets)} "
                      f"{(self.nets[0].fitness / (len(self.nets)))*100:.2f}%")

                # Copy top half of nets into bottom half of nets and mutate the bottom half
                for i in range(len(self.nets) // 2):
                    old_id = self.nets[i].id  # Preserve id past copy
                    self.nets[i] = self.nets[-(i+1)].copy()  # Copy top half
                    self.nets[i].mutate(self.mutate_rate, self.mutate_strength)
                    self.nets[i].id = old_id  # Set old id back

                # Save population to file when pickle is imported
                with open("saved_population.pkl", "wb") as file:
                    pickle.dump(self.nets, file, pickle.HIGHEST_PROTOCOL)

                # Reset timer and counter
                start_time = time.time()
                generation += 1
        print("Training complete.")
        return self.nets[-1]
